<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Management of ocular inflammation and pain following cataract surgery : focus on bromfenac ophthalmic solution . Recently , several new ophthalmic NSAID products have been introduced for commercial use in the United States . The purpose of this review is to briefly overview the ophthalmic NSAIDs currently in use and to discuss the management of postoperative ocular inflammation and pain following cataract surgery with a particular focus on bromfenac ophthalmic solution 0.09 % .

 , P12036 ,

 and Q8IX03 genes . The importance of these findings and future directions are discussed . SUMMARY : Recent genetic studies have revealed emerging aspects and extended the existing knowledge regarding the pathogenesis of neurotrauma and the genetic influence on phenotypic diversity . A better understanding of the underlying biological pathways and molecular mechanisms of an individual ' s response to neurotrauma may hold the promise of novel treatment strategies and improved clinical outcome .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Modulation of GSK - 3β activity in Venezuelan equine encephalitis virus infection . Alphaviruses , including Venezuelan Equine Encephalitis Virus ( VEEV ) , cause disease in both equine and humans that exhibit overt encephalitis in a significant percentage of cases . Features of the host immune response and tissue-specific responses may contribute to fatal outcomes as well as the development of encephalitis . It has previously been shown that VEEV infection of mice induces transcription of pro-inflammatory cytokines genes ( e . g . , IFN-γ , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , IL - 12 ,

 - α ) within 6 h . GSK - 3β is a host protein that is known to modulate pro-inflammatory gene expression and has been a therapeutic target in neurodegenerative disorders such as Alzheimer ' s . Hence inhibition of GSK - 3β in the context of encephalitic viral infections has been useful in a neuroprotective capacity . Small molecule GSK - 3β inhibitors and GSK - 3β siRNA experiments indicated that GSK - 3β was important for VEEV replication . Thirty-eight second generation BIO derivatives were tested and BIOder was found to be the most potent inhibitor , with an IC ( 50 ) of ∼ 0.5 µM and a CC ( 50 ) of &gt; 100 µM . BIOder was a more potent inhibitor of GSK - 3β than BIO , as demonstrated through in vitro kinase assays from uninfected and infected cells . Size exclusion chromatography experiments demonstrated that GSK - 3β is found in three distinct complexes in VEEV infected cells , whereas GSK - 3β is only present in one complex in uninfected cells . Cells treated with BIOder demonstrated an increase in the anti-apoptotic gene , survivin , and a decrease in the pro-apoptotic gene ,

 , suggesting that modulation of pro - and anti-apoptotic genes contributes to the protective effect of BIOder treatment . Finally , BIOder partially protected mice from VEEV induced mortality . Our studies demonstrate the utility of GSK - 3β inhibitors for modulating VEEV infection .</div>

<h2 style="margin: 0">12</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Alterations in brain extracellular dopamine and glycine levels following combined administration of the glycine transporter type - 1 inhibitor Org - 24461 and risperidone . The most dominant hypotheses for the pathogenesis of schizophrenia have focused primarily upon hyperfunctional dopaminergic and hypofunctional glutamatergic neurotransmission in the central nervous system . The therapeutic efficacy of all atypical antipsychotics is explained in part by antagonism of the dopaminergic neurotransmission , mainly by blockade of D ( 2 ) dopamine receptors . N-methyl-D-aspartate ( DB01221 ) receptor hypofunction in schizophrenia can be reversed by glycine transporter type - 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48067
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) inhibitors , which regulate glycine concentrations at the vicinity of DB01221 receptors . Combined drug administration with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 blockade and activation of hypofunctional DB01221 receptors may be needed for a more effective treatment of positive and negative symptoms and the accompanied cognitive deficit in schizophrenia . To investigate this type of combined drug administration , rats were treated with the atypical antipsychotic risperidone together with the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48067
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitor Org - 24461 . Brain microdialysis was applied in the striatum of conscious rats and determinations of extracellular dopamine , DOPAC , HVA , glycine , glutamate , and serine concentrations were carried out using HPLC / electrochemistry . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00734
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MENMAX</span>
</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00734
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 increased extracellular concentrations of dopamine but failed to influence those of glycine or glutamate measured in microdialysis samples . Org - 24461 injection reduced extracellular dopamine concentrations and elevated extracellular glycine levels but the concentrations of serine and glutamate were not changed . When risperidone and Org - 24461 were added in combination , a decrease in extracellular dopamine concentrations was accompanied with sustained elevation of extracellular glycine levels . Interestingly , the extracellular concentrations of glutamate were also enhanced . Our data indicate that coadministration of an antipsychotic with a 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48067
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitor may normalize hypofunctional DB01221 receptor-mediated glutamatergic neurotransmission with reduced dopaminergic side effects characteristic for antipsychotic medication .</div>
